import React, { Component } from 'react';
import './Nav.css';
import {  NavLink, Route, Link } from "react-router-dom";
import List from './List.js';
import Home from './Home.js';

const links = ["Home.js",
  "List.js",
  "Area.js",
  "Citations.js"];
const bar = links.map((link) =>
  <li>{link}</li>
);

class Nav extends Component {
  render() {
    return (
      <div className="navbar">
        <header className="nav">
          <nav class = "main">
            <Route path={"/list"} component={List}/>
            <Route path={"/home"} component={Home}/>
        		<ul class = "bar">
          		<NavLink to="/home"><li class = "linkitem">Home</li></NavLink>
              <NavLink to="/list"><li class = "linkitem">List Of Illnesses</li></NavLink>
              <li class = "linkitem"><a href = "List.js" class = "link">List of Illnesses</a></li>
              <li class = "linkitem"><a href = "" class = "link">Area</a></li>
              <li class = "linkitem"><a href = "" class = "link">Citations</a></li>
            </ul>
          </nav>
        </header>
      </div>
    );
  }
}

export default Nav;
